import React from "react";
import {
  FiGithub,
  FiLinkedin,
  FiFigma,
} from "react-icons/fi";
import { FaReact, FaHtml5 } from 'react-icons/fa';
import { DiJavascript } from 'react-icons/di';




const skillsContent = [
  {
    name: "React",
    iconName: <FaReact style={{ height: 50, width: 50}}/>,

  },
  {
    name: "Javascript",
    iconName: <DiJavascript style={{ height: 50, width: 50}}/>,
  },
  {
    name: "Photoshop",
    iconName: <FiGithub />,
  },
  {
    name: "Figma",
    iconName: <FiFigma style={{ height: 50, width: 50}}/>,
  },
  {
    name: "Illustrator",
    iconName: <FiGithub />,
  },
  {
    name: "WordPress",
    iconName: <FiGithub />,
  },
];

const Skills = () => {
  return (
    <>
      {skillsContent.map((val, i) => (
        <div className="progress_inner" key={i} >
          <span className="label">{val.name}</span>
          <div>
            {val.iconName}
          </div>
        </div>
      ))}
    </>
  );
};

export default Skills;
